import React from 'react'
import classes from './AnimeCharacter'
import { Swiper, SwiperSlide, Navigation, Pagination  } from "swiper/react";
import tanjiro from '../assets/5ede491bb760540004f2c5e1.png'
import "swiper/swiper.min.css";
import "swiper/components/effect-coverflow/effect-coverflow.min.css";
import "swiper/components/pagination/pagination.min.css";
import "swiper/components/navigation/navigation.min.css";
import 'swiper/swiper-bundle.min.css'
import 'swiper/swiper.min.css';
import Slider from 'react-slick';
export default function AnimeCharacter() {
  var settings = {
    dots: true,
    infinite: true,
    slidesToShow: 3,
    slidesToScroll: 1,
    // autoplay: true,
    // autoplaySpeed: 2000,
    pauseOnHover: true
  };
  return (
    <div >
    <h2>Pause On Hover</h2>
    <Slider {...settings} className={classes.cont}>
      <div>
        
        <img className={classes['character']} src={tanjiro}/>
      </div>
      <div>
        <h3>2</h3>
      </div>
      <div>
        <h3>3</h3>
      </div>
      <div>
        <h3>4</h3>
      </div>
      <div>
        <h3>5</h3>
      </div>
      <div>
        <h3>6</h3>
      </div>
    </Slider>
  </div>
  )
}
